import React from "react";

import styled from "styled-components";

interface IProps {
  title: String;
}

const StyledNavItem = styled.p`
    font-size: small;
    text-transform: capitalize,
    &:hover {
        color: black;
        font-weight: bold;
    },
`;

const NavItem: React.FC<IProps> = ({ title }) => {
  return <StyledNavItem style={{ cursor: "pointer" }}>{title}</StyledNavItem>;
};

export default NavItem;
